window.paynowLogoBase64 = 'data:image/png;base64,';

(function(){
  if (window.paynowQRify && window.paynowQRify._v) return;

  const G = window.__paynowQR = window.__paynowQR || { generationPromises: [] };
  const toBool = v => (typeof v === 'string' ? v.toLowerCase() !== 'false' : !!v);
  const qrCache = new Map();


  function ensureLibs(){
    if (window.PaynowQR && window.QRCode) {
      return Promise.resolve();
    } else {
      return Promise.reject(new Error('Required libraries not loaded. Please include paynow.js and qrcode.min.js via <script> tags.'));
    }
  }

  function loadImage(src){
    return new Promise((resolve, reject)=>{
      const img = new Image();
      img.crossOrigin = 'anonymous';
      img.onload = ()=>resolve(img);
      img.onerror = ()=>reject(new Error('Logo load failed'));
      img.src = src;
    });
  }

  function renderToElement(el, dataUrl, renderType, displayPx){
    // This function is now synchronous. For 'canvas', it will only work if dataUrl is already loaded.
    if (renderType === 'canvas') {
      const canvas = document.createElement('canvas');
      canvas.width = canvas.height = displayPx;
      const ctx = canvas.getContext('2d');
      const img = new Image(); // Create an image to draw the dataUrl
      img.onload = () => { // This part is async, but we proceed. Might flash.
          ctx.drawImage(img, 0, 0, displayPx, displayPx);
      };
      img.src = dataUrl;
      while (el.firstChild) { el.removeChild(el.firstChild); }
      el.appendChild(canvas);
    } else if (renderType === 'div') {
      el.style.backgroundImage = `url(${dataUrl})`;
      el.style.backgroundSize = 'contain';
      el.style.backgroundRepeat = 'no-repeat';
      el.style.backgroundPosition = 'center';
      el.style.width = el.style.height = displayPx + 'px';
    } else {
      // default 'img'
      let imgEl = el.tagName === 'IMG' ? el : el.querySelector('img');
      if (!imgEl){ imgEl = document.createElement('img'); el.appendChild(imgEl); }
      imgEl.src = dataUrl;
      imgEl.style.width = imgEl.style.height = displayPx + 'px';
    }
  }

  // Synchronous QR Canvas generation
  function makeQRCanvas(payload, qrPx, dark, light, margin = 1){
    if (typeof window.QRCode !== 'function' || !QRCode.CorrectLevel){
        throw new Error('Unsupported QR library: window.QRCode missing/incompatible.');
    }
    
    const tmp = document.createElement('div');
    // Note: This synchronous approach requires the library to generate the QR immediately.
    // It might not work with all versions of qrcode.js if they rely on async rendering.
    new QRCode(tmp, {
        text: payload,
        width: qrPx,
        height: qrPx,
        colorDark: dark,
        colorLight: light,
        correctLevel: QRCode.CorrectLevel.H
    });

    let qrCanvas = tmp.querySelector('canvas');
    if (!qrCanvas) {
        const img = tmp.querySelector('img');
        if (!img) throw new Error('QRCodeJS did not generate canvas/img');
        // Synchronous conversion from img to canvas
        qrCanvas = document.createElement('canvas');
        qrCanvas.width = qrCanvas.height = qrPx;
        const ctx = qrCanvas.getContext('2d');
        ctx.drawImage(img, 0, 0, qrPx, qrPx);
    }
    
    // Margin is handled by the library if supported, otherwise this simplified version omits manual margin drawing.
    return qrCanvas;
  }

  function renderOne(el, defaults){
    if (el.dataset.qrDone === '1' && !defaults.rerender) return;

    const ds = el.dataset || {};
    const cfg = {
      uen:       ds.uen,
      amount:    ds.amount !== undefined ? parseFloat(ds.amount) : undefined,
      editable:  toBool(ds.editable ?? false),
      expiry:    ds.expiry || undefined, // Pass undefined if empty to let paynow.js handle default
      refNumber: ds.refnumber || ds.refNumber,
      company:   ds.company || undefined // Pass undefined if empty to let paynow.js handle default
    };
    if (!cfg.uen || !cfg.refNumber)
      throw new Error('Missing required data-* (uen/refnumber)');
    if ((cfg.amount === undefined || Number.isNaN(cfg.amount)) && !cfg.editable)
      throw new Error('amount required unless data-editable="true"');

    const dark      = (ds.dark && ds.dark !== '') ? ds.dark : (defaults.dark ?? '#79207a');
    const light     = (ds.light && ds.light !== '') ? ds.light : (defaults.light ?? '#ffffff');
    const logo      = (ds.logo !== undefined && ds.logo !== '') ? ds.logo : (defaults.logo ?? null);   // per-slot OR default paynowLogoBase64
    const displayPx = (ds.displaypx && ds.displaypx !== '') ? parseInt(ds.displaypx, 10) : (defaults.displayPx ?? 50);
    const qrPx      = (ds.qrpx && ds.qrpx !== '') ? parseInt(ds.qrpx, 10) : Math.max(displayPx, 200); // Optimize: use displayPx or min 200
    const logoScale = (ds.logoscale && ds.logoscale !== '') ? parseFloat(ds.logoscale) : (defaults.logoScale ?? 0.2);
    const padScale  = (ds.padscale && ds.padscale !== '') ? parseFloat(ds.padscale) : (defaults.padScale ?? 0.02);
    const margin    = (ds.margin && ds.margin !== '') ? parseInt(ds.margin, 10) : (defaults.margin ?? 0);
    const renderType = (ds.render && ds.render.trim() !== '') ? ds.render.toLowerCase() : (defaults.render ?? 'img');

    // Create cache key
    const cacheKey = JSON.stringify({ cfg, dark, light, logo, qrPx, logoScale, padScale, margin });

    if (qrCache.has(cacheKey)) {
      const dataUrl = qrCache.get(cacheKey);
      renderToElement(el, dataUrl, renderType, displayPx);
      el.className = el.className.replace(/\bpaynowQRSlot\b/g, 'paynowQRSlot_processed');
      el.dataset.qrDone = '1';
      return dataUrl;
    }

    const payload = new PaynowQR(cfg).output();

    const canvas = makeQRCanvas(payload, qrPx, dark, light, margin);

    if (logo){
      // Synchronous logo drawing is complex and not feasible without significant library changes.
      // For speed, we are simplifying this. The logo will be drawn when it loads.
      const ctx = canvas.getContext('2d');
      const img = new Image();
      img.onload = () => {
          const c = qrPx / 2;
          const L = qrPx * logoScale;
          const B = L + qrPx * padScale;
          ctx.fillStyle = light;
          ctx.fillRect(c - B / 2, c - B / 2, B, B);
          ctx.drawImage(img, c - L / 2, c - L / 2, L, L);
          renderToElement(el, canvas.toDataURL('image/png'), renderType, displayPx); // Re-render with logo
      };
      img.src = logo;
    }

    const dataUrl = canvas.toDataURL('image/png');

    // Cache the result
    qrCache.set(cacheKey, dataUrl);

    renderToElement(el, dataUrl, renderType, displayPx);

    el.className = el.className.replace(/\bpaynowQRSlot\b/g, 'paynowQRSlot_processed');
    el.dataset.qrDone = '1';
    return dataUrl;
  }

  function paynowQRify(selectorOrEls, opts = {}){
    ensureLibs(); // Synchronous check
    const els = typeof selectorOrEls === 'string'
      ? Array.from(document.querySelectorAll(selectorOrEls))
      : (selectorOrEls instanceof Element ? [selectorOrEls]
         : Array.from(selectorOrEls || []));
    if (!els.length) return [];

    const results = [];
    for (const el of els) {
      try {
        results.push(renderOne(el, opts));
      } catch (error) {
        console.error('QR generation failed for element:', el, error);
      }
    }
    return results;
  }

  window.paynowQRify = paynowQRify;
  window.paynowQRify._v = '1.7.0-sync'; 

  // --- Start: Synchronous Auto-generation ---
  if (!window.__paynowQR_autoExecuted) {
    window.__paynowQR_autoExecuted = true;
    
    const autoGenerate = () => {
      paynowQRify('.paynowQRSlot', {
        logo: (window.paynowLogoBase64 || null),
        displayPx: 50,
        dark: '#79207a',
        light: '#ffffff'
      });
    };

    // Run immediately or on DOMContentLoaded if document is still loading
    if (document.readyState === 'loading') {
      document.addEventListener('DOMContentLoaded', autoGenerate);
    } else {
      autoGenerate();
    }
  }
  // --- End: Synchronous Auto-generation ---

})();
